//META{"name":"NoticeMeSenpai"}*//

'use strict';

function NoticeMeSenpai()
	{
	function obs_dm(m)
		{
		if(m[0].addedNodes.length)
			{
			audio.play();
			}
		}

	const
		_=this;
	var
		audio,
		obs;

	_.getName=()=>'Notice Me, Senpai!';
	_.getDescription=()=>'Creates a Meow sound when you receive a Direct Message';
	_.getVersion=()=>'0.04';
	_.getAuthor=()=>'XFox Prower';
	_.load=()=>{};
	_.start=()=>
		{
		audio=new Audio('data:audio/ogg;base64,');
		obs=new MutationObserver(obs_dm);
		obs.observe(document.getElementsByClassName('dms')[0],{childList:1});
		};
	_.stop=()=>
		{
		audio=null;
		obs.disconnect();
		};
	_.getSettingsPanel=()=>
		{
		return '';
		};
	}
